import React from 'react';
import './App.css';
import { Icon } from 'semantic-ui-react'

function App() {
  return (
    <React.Fragment>
      <Icon.Group size='mini'>
        <Icon name="linkedin"/>
      </Icon.Group>
    </React.Fragment>
  );
}

export default App;
